import { Link, useNavigate } from 'react-router-dom';
import './login.css'
import { useEffect, useState } from 'react';


    function Login () {
        const [clients, setClients] = useState([]); 
        const [error, setError] = useState(''); 
        const navigate = useNavigate(); 

        useEffect(() => {
            fetch('http://localhost:8080/cliente', {
                method: 'GET',
                mode: 'cors'
            })
            .then(res => {
                if (!res.ok) {
                    throw new Error('Falha ao buscar dados dos usuários');
                }
                return res.json();
            })
            .then(data => {
                setClients(data); 
            })
            .catch(error => {
                console.error('Erro ao carregar dados dos clientes:', error);
                setError('Erro ao carregar dados, tente novamente.');
            });
        }, []);
    
        const handleLogin = (e) => {
            e.preventDefault();
            const usuario = document.getElementById('user').value;
            const senha = document.getElementById('pass').value;
    
            
            const user = clients.find(client => client.usuario === usuario && client.senha === senha);
    
            if (user) {
                localStorage.setItem('token', 'fake-jwt-token'); 
                localStorage.setItem('userId', user.idCliente);
                navigate('/kraken/');
            } else {
                setError('Usuário ou senha incorretos.');
            }
        };
    return (
        <>
        <div>
            <div className='container-login'>
                <div className='content-login'>
                    <div className='login'>
                        <div className='logo-login'>
                            <img src="data:image/jpeg;base64," />
                        </div>
                        <div className='input-user'>
                            <input type='text' id='user' name='usuario' className="input-field-user" required/>
                            <label htmlFor='user'>usuario</label>
                        </div>
                        <div className='input-pass'>
                            <input type='password' id='pass' name='senha' className="input-field-pass" required/>
                            <label htmlFor='user'>senha</label> 
                        </div>
                        <div className='btn-login'>
                            <button onClick={handleLogin}  className='longin-btn signin'>Sign in</button>
                            <Link to='/cadastro' className='longin-btn signup'> Sign up</Link>
                        </div>
                    </div>
                </div>
            </div>
        </div>
        </>
    )
}

export default Login;